    false,nt"url": null,nt"notes": "The Chinese National Oceanographic Data
    Center provided NODC with 13ntapes of CTD, XBT, station data, chlorophyll, primary
    productivity andnvessel report data collected as part of Tropical Ocean Global Atmospheren(TOGA)
    project. This reference number represents data from two tapesncontaining vessel
    report data from January 1968 to December 1982. Thenvessel report data was used
    to compile the Climatic Charts of Bohai Sea,nYellow Sea and East China Sea. Parameters
    included in the data set are:nwind data, atmospheric pressure, cloud data, sea surface
    temperature,nwave and surge data, and ice accretion data. Reference number L00871nrepresents
    the months January-June, 1968 to 1982; Reference numbernL00872 represents the months
    July to December 1968 to 1982. The data hasnbeen processed by NODC and is available
    in C100 Ocean Station data filenformat.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
